import React from 'react';
import { FcLike } from 'react-icons/fc';

const Card = (props) => {
  let course = props.course;
  return (
    <div>

      <div>

        <div> 
          <img src={course.img.url} />
        </div>

        <div>
          <button> <FcLike fontSize="1.75rem" /> </button>
        </div>

        <div>
          <p>{course.title}</p>
          <p>{course.description}</p>
        </div>

      </div>

    </div>
  )
}

export default Card
